import React from 'react';
//리액트 코드를 작성할떄 필수적으로 리액트를 가져와야함

const LoginPage = () => {
    return (
        <div>
            <h1>로그인 페이지</h1>
            <form>
                <input type="text" placeholder="아이디" />
                <input type="password" placeholder="비밀번호" />
                <button type="submit">로그인</button>
            </form>
        </div>
    );
};

export default LoginPage;
